sys_variable_value.value:
(function execute(inputs, outputs) {
  var dataSourceSysId = inputs.dataSourceSysId;
  var maxRow = inputs.maxRow;
  //Get Data from source
  var dataSource = new SGCEnhanceDataSource(dataSourceSysId);
  var importSetSysId = dataSource.loadData(maxRow);
  if(importSetSysId){
    var importSetGr = new GlideRecord('sys_import_set');
    if(importSetGr.get(importSetSysId)){
      new SGCEnhanceNotification().postSimpleNotificationToUser(gs.getUserID(), importSetGr, importSetGr.getDisplayValue(), "The data source has completed loading.", "Loaded");
    }
  }else{
    var dataSourceGr = new GlideRecord('sys_data_source');
    if(dataSourceGr.get(dataSourceSysId)){
      new SGCEnhanceNotification().postSimpleNotificationToUser(gs.getUserID(), dataSourceGr, dataSourceGr.getDisplayValue(), "The data source was not able to complete loading.", "Error");
    }
  }


})(inputs, outputs);

